INSERT INTO `movies` (`id`, `title`, `description`, `thumbnail`, `video_url`, `release_year`, `is_featured`, `created_at`, `updated_at`, `genre_id`) VALUES
(5, 'When Life Gives You Tangerines', 'In Jeju, a spirited girl and a steadfast boy\'s island story blossoms into a lifelong tale of setbacks and triumphs — proving love endures across time.', 'http://127.0.0.1:8000/storage/uploads/images/1748939058_khi-cuoc-doi-cho-ban-qua-quyt-01.jpg', 'http://127.0.0.1:8000/storage/uploads/videos/1747673091_185787-876545918_large.mp4', '2025', 1, '2025-05-19 09:44:56', '2025-06-03 02:37:26', 1),
(8, 'The Holiday', 'An American romantic movie, not only for Christmas, but also suitable for “sipping” on weekends. The movie is about two modern women with two different styles and living conditions who decided to exchange “lives” with each other.', 'http://127.0.0.1:8000/storage/uploads/images/1748969441_WWK-top-5-phim-tinh-cam-lang-man-netflix-cuoi-tuan-2022-the-holiday.jpg', 'http://127.0.0.1:8000/storage/uploads/videos/1747707614_istockphoto-1885261180-640_adpp_is.mp4', '2001', 0, '2025-05-19 19:20:21', '2025-06-03 09:51:05', 1),
(9, 'Crash Landing on You', 'Crash Landing: The Last Airbender revolves around the love story of a South Korean heiress named Yoon Se Ri (Son Ye Jin) and a North Korean officer named Ri Jung Hyuk (Hyun Bin). During a parachute jump, she accidentally landed in North Korean territory due to weather conditions and accidentally \"fell into the arms\" of an officer. As Jung Hyuk helped Se Ri hide her identity and protect her, the two gradually developed feelings for each other.', 'http://127.0.0.1:8000/storage/uploads/images/1748969770_phim-hay-tren-netflix-3.jpg', 'http://127.0.0.1:8000/storage/uploads/videos/1748951378_185787-876545918_large.mp4', '2019', 0, '2025-05-01 10:00:00', '2025-06-03 09:56:13', 1),
(10, 'Man In Love', 'The Korean romance film \"Marriage Without Loss\" revolves around the romantic and humorous story between Son Hae Yeong (Shin Min Ah) and Kim Ji Uk (Kim Young Dae). Son Hae Yeong is a practical woman who always values ​​the value of effort and never wants to suffer a loss in any relationship. Facing the risk of missing out on a promotion opportunity, she decides to plan a fake wedding. The person she chooses as the fake groom is Kim Ji Uk - a part-time cashier at a convenience store. Kim Ji Uk is always helpful to others and has a friendly relationship with everyone, except Hae Yeong. Although he often conflicts with Hae Yeong, he still agrees to participate in her fake plan. From here, a series of funny and sad situations take place, bringing them closer together and giving rise to special emotions.', 'http://127.0.0.1:8000/storage/uploads/images/1748969538_WWK-top-5-phim-tinh-cam-lang-man-netflix-cuoi-tuan-2022-man-in-love.jpg', 'http://127.0.0.1:8000/storage/uploads/videos/1748951564_istockphoto-1885261180-640_adpp_is.mp4', '2024', 0, '2025-05-02 11:00:00', '2025-06-03 09:52:21', 1),
(11, 'What Comes After Love', 'What Comes After Love” is a romantic drama film created from the collaboration between Korean and Japanese crews based on the best-selling melodrama novel \"Things that Come After Love\" (2005). Telling the love story between two ex-lovers after many years of separation, the film begins with the sweet and deep youthful love between Hong - a Korean girl studying in Japan, and Jungo, a native boy. Their love was once very dreamy and attached, but differences in life views and life events caused them to break up. After 5 years apart, fate once again made them meet again in Korea. The memories and broken pieces of old love suddenly arose strongly when they faced each other, causing both of them to face unresolved emotions. The film raises the question of whether love can overcome time and old hurts, whether the two can recreate their relationship and heal the wounds of the past. past?', 'http://127.0.0.1:8000/storage/uploads/images/1748969704_phim-hay-tren-netflix-6.jpg', 'http://127.0.0.1:8000/storage/uploads/videos/1748951689_185787-876545918_large.mp4', '2024', 0, '2025-05-03 12:00:00', '2025-06-03 09:55:08', 1),
(12, 'Be With You', 'The film is about a woman (Son Ye Jin); before she passed away, she made an unbelievable promise to her husband (So Ji Sub) that she would return after a year. A year later, that woman really appeared, but all her memories of them had disappeared. Woo Jin took steps to help Soo A reawaken the memories she had forgotten.', 'http://127.0.0.1:8000/storage/uploads/images/1748963362_37-phim-tinh-cam-han-quoc-hay-nhat-lay-nuoc-mat-nguoi-xem-202206041517514747.jpg', 'http://127.0.0.1:8000/storage/uploads/videos/1748963381_istockphoto-1885261180-640_adpp_is.mp4', '2004', 1, '2025-05-04 13:00:00', '2025-06-03 08:10:37', 1),
(13, 'Man of Steel', 'Plot: An alien child is evacuated from his dying world and sent to Earth to live among humans. His peace is threatened when other survivors from his home planet invade Earth. The boy discovers that he has extraordinary abilities and is not of this Earth. As he grows into a young man, he journeys to discover where he came from and why he was sent here. His inner hero must emerge if he is to save the world from destruction and become a symbol of hope for all of humanity.', 'http://127.0.0.1:8000/storage/uploads/images/1748963979_phim-hanh-dong-hay-tren-netflix-1.png', 'http://127.0.0.1:8000/storage/uploads/videos/1748964017_185787-876545918_large.mp4', '2005', 1, '2025-05-05 14:00:00', '2025-06-03 08:20:22', 3),
(14, 'The Bodyguard', '“The Bodyguard” is a 1992 American action and suspense film that Gamikey would like to introduce to everyone, this is a film directed by Mick Jackson.', 'http://127.0.0.1:8000/storage/uploads/images/1748964188_phim-hanh-dong-hay-tren-netflix-2.png', 'http://127.0.0.1:8000/storage/uploads/videos/1748964171_istockphoto-1885261180-640_adpp_is.mp4', '2006', 1, '2025-05-06 15:00:00', '2025-06-03 08:23:32', 3),
(15, 'Money Heist', '“Money Heist – Phi vụ triệu đô” là một seri phim hành động, tội phạm và hồi hộp, được đạo diễn bởi Álex Pina. Nội dung phim kể về hai phi vụ cướp lớn được chuẩn bị kỹ lưỡng do Giáo sư (Álvaro Morte nhận vai) lãnh đạo, một phi vụ tại Nhà in tiền Hoàng gia Tây Ban Nha, và một phi vụ tại Ngân hàng Tây Ban Nha, được kể từ góc nhìn của một trong những tên cướp, Tokyo (Úrsula Corberó nhận vai). Trong phim có một người đàn ông bí ẩn được biết đến với cái tên “Giáo sư” tuyển dụng một nhóm gồm tám người, họ chọn tên các thành phố làm bí danh, để thực hiện một kế hoạch tham vọng liên quan đến việc vào Nhà in tiền Hoàng gia Tây Ban Nha và trốn thoát với 2,4 tỷ euro.', 'http://127.0.0.1:8000/storage/uploads/images/1748964255_phim-hanh-dong-hay-tren-netflix-3.png', 'http://127.0.0.1:8000/storage/uploads/videos/1748964273_185787-876545918_large.mp4', '2007', 1, '2025-05-07 16:00:00', '2025-06-03 08:24:41', 3),
(16, 'Outside The Wire', '“Outside The Wire” is a 2021 American science fiction action film directed by Mikael Håfström. It tells the story of a drone pilot, Lt. Thomas Harp (Damson Idris), who is sent into a deadly military area after disobeying orders, only to find himself working for Capt. Leo (Anthony Mackie), a top-secret android officer tasked with finding a destructive device before rebels do.', 'http://127.0.0.1:8000/storage/uploads/images/1748968552_phim-hanh-dong-hay-tren-netflix-4.png', 'http://127.0.0.1:8000/storage/uploads/videos/1748968561_istockphoto-1885261180-640_adpp_is.mp4', '2016', 0, '2025-05-16 15:00:00', '2025-06-03 09:38:11', 3),
(17, '12 Strong', 'The film tells the story of a top-secret mission in Afghanistan after the events of September 11. A Special Forces team led by Captain Mitch Nelson (Chris Hemsworth) is sent to Afghanistan by the government to respond to the attack on the United States. 12 elite soldiers leave their families and travel to the harsh land of northern Afghanistan to convince local soldiers to join them in fighting against the Taliban and Al Qaeda.', 'http://127.0.0.1:8000/storage/uploads/images/1748968904_phim-hanh-dong-hay-tren-netflix-6.png', 'http://127.0.0.1:8000/storage/uploads/videos/1748968963_185787-876545918_large.mp4', '2017', 1, '2025-05-17 16:00:00', '2025-06-03 09:42:51', 3),
(18, 'Space Sweepers', '“The Martian” tells the story of Mark Watney (Matt Damon), an American astronaut who was presumed dead and left stranded on Mars after a violent sandstorm. Using his intelligence, optimism, and courage, Watney uses his scientific knowledge and survival skills to survive on this harsh planet while waiting for rescue.“The Martian” tells the story of Mark Watney (Matt Damon), an American astronaut who was presumed dead and left stranded on Mars after a violent sandstorm. Using his intelligence, optimism, and courage, Watney uses his scientific knowledge and survival skills to survive on this harsh planet while waiting for rescue.', 'http://127.0.0.1:8000/storage/uploads/images/1748969151_phim-hanh-dong-hay-tren-netflix-7.png', 'http://127.0.0.1:8000/storage/uploads/videos/1748969085_istockphoto-1885261180-640_adpp_is.mp4', '2018', 1, '2025-05-18 17:00:00', '2025-06-03 09:46:19', 3),
(19, 'Liverpool Champions 2025', 'Liverpool Football Club is a professional football club based in Liverpool, England. The club competes in the Premier League, the top tier of English football. Founded in 1892, the club joined the Football League the following year and has played its home games at Anfield since its formation. Liverpool is one of the most valuable and widely supported clubs in the world.', 'http://127.0.0.1:8000/storage/uploads/images/1748970085_champions2425.jpg', 'http://127.0.0.1:8000/storage/uploads/videos/1748970108_185787-876545918_large.mp4', '2019', 0, '2025-05-19 18:00:00', '2025-06-03 10:05:08', 2),
